export default function ImagePopup(props) {
  return (
    <>
      <div className={`popup popup_zoom-pic ${props.card ? "popup_opened" : ""}`}>
        <figure className="popup__figure-container">
          <img className="popup__picture" style={{ backgroundImage: `url(${props.card})` }} alt="" />
          <figcaption className="popup__picture-cap">{props.card}</figcaption>
          <button className="popup__close-button" type="button" aria-label="закрыть" onClick={props.onClose}></button>
        </figure>
      </div>
    </>
  );
}
